import React from 'react';

const NominationList = ({ nominations, onRemoveNomination }) => {
    const renderedList = nominations.map((nomination) => {
        return (
            <div>
                <div key={nomination.imdbID}>{nomination.Title}</div>
                <button>Info</button>
                <button onClick={() => onRemoveNomination(nomination)}>Remove</button>
            </div>
        );
    });

    if (nominations.length === 0) {
        return (
            <div>There are no nominations</div>
        );
    }

    return (
        <div>
            Nominations:
            {renderedList}
        </div>
    );
};

export default NominationList;
